import { useEffect,useState } from "react";
export default function Header()
{
    const [msg,setmsg] = useState([]);
    const fetchmsg = async () => {
        const resp = await fetch("http://127.0.0.1:8000/")
        const sent = await resp.json()
        setmsg(sent.data)
    }
    useEffect(()=>{fetchmsg()},[])    
    return (
        <div>
            <h1>{msg}</h1>

        </div>
    )
}
